import React, { useEffect, useState } from 'react';
import axios from 'axios';

function BookingList() {
  const [bookings, setBookings] = useState([]);
  const [editingBookingId, setEditingBookingId] = useState(null);
  const [updatedBookingData, setUpdatedBookingData] = useState({
    bookingDate: '',
    duration: 1,
    name: '',
    contactNumber: '',
    email: '',
    paymentAmount: 0,
    startTime: '',
    endTime: '',
    status: 'Upcoming'
  });

  useEffect(() => {
    fetchBookings();
  }, []);

  const fetchBookings = () => {
    axios.get('/bookings/getAllBookings')
      .then(response => {
        setBookings(response.data);
      })
      .catch(error => {
        console.error('Error fetching bookings:', error);
      });
  };

  const handleDelete = (id) => {
    axios.delete(`/bookings/deleteBooking/${id}`)
      .then(() => {
        setBookings(bookings.filter(booking => booking.bookingId !== id));
      })
      .catch(error => {
        console.error('Error deleting booking:', error);
      });
  };

  const handleEdit = (booking) => {
    setEditingBookingId(booking.bookingId);
    setUpdatedBookingData({
      bookingDate: booking.bookingDate,
      duration: booking.duration,
      name: booking.name,
      contactNumber: booking.contactNumber,
      email: booking.email,
      paymentAmount: booking.paymentAmount,
      startTime: booking.startTime,
      endTime: booking.endTime,
      status: booking.status
    });
  };

  const handleUpdate = (id) => {
    axios.put(`/bookings/updateBooking/${id}`, updatedBookingData)
      .then(() => {
        fetchBookings(); // Refresh list after update
        setEditingBookingId(null); // Reset editing state
      })
      .catch(error => {
        console.error('Error updating booking:', error);
      });
  };

  useEffect(() => {
    const checkExpiredBookings = () => {
      const currentDateTime = new Date();
      bookings.forEach(booking => {
        const endTime = new Date(booking.endTime);
        if (endTime < currentDateTime && booking.status !== 'Expired') {
          axios.put(`/bookings/expireBooking/${booking.bookingId}`)
            .then(() => {
              fetchBookings();
            })
            .catch(error => console.error('Error expiring booking:', error));
        }
      });
    };
    const intervalId = setInterval(checkExpiredBookings, 60000);
    return () => clearInterval(intervalId);
  }, [bookings]);

  return (
    <div>
      <h2>Booking List</h2>
      <ul>
        {bookings.map(booking => (
          <li key={booking.bookingId}>
            {editingBookingId === booking.bookingId ? (
              <div>
                <input
                  type="date"
                  value={updatedBookingData.bookingDate}
                  onChange={(e) => setUpdatedBookingData({ ...updatedBookingData, bookingDate: e.target.value })}
                />
                <input
                  type="text"
                  value={updatedBookingData.name}
                  onChange={(e) => setUpdatedBookingData({ ...updatedBookingData, name: e.target.value })}
                  placeholder="Name or ID"
                />
                <input
                  type="tel"
                  value={updatedBookingData.contactNumber}
                  onChange={(e) => setUpdatedBookingData({ ...updatedBookingData, contactNumber: e.target.value })}
                  placeholder="Contact Number"
                />
                <input
                  type="email"
                  value={updatedBookingData.email}
                  onChange={(e) => setUpdatedBookingData({ ...updatedBookingData, email: e.target.value })}
                  placeholder="Email (@cit.edu only)"
                />
                <input
                  type="number"
                  value={updatedBookingData.paymentAmount}
                  onChange={(e) => setUpdatedBookingData({ ...updatedBookingData, paymentAmount: e.target.value })}
                  placeholder="Payment Amount"
                  min="0"
                />
                <input
                  type="time"
                  value={updatedBookingData.startTime}
                  onChange={(e) => setUpdatedBookingData({ ...updatedBookingData, startTime: e.target.value })}
                  placeholder="Time to Come In"
                />
                <input
                  type="time"
                  value={updatedBookingData.endTime}
                  onChange={(e) => setUpdatedBookingData({ ...updatedBookingData, endTime: e.target.value })}
                  placeholder="Time to End Out"
                />
                <select
                  value={updatedBookingData.status}
                  onChange={(e) => setUpdatedBookingData({ ...updatedBookingData, status: e.target.value })}
                >
                  <option value="Upcoming">Upcoming</option>
                  <option value="Ongoing">Ongoing</option>
                  <option value="Completed">Completed</option>
                  <option value="Expired">Expired</option>
                </select>
                <button onClick={() => handleUpdate(booking.bookingId)}>Save</button>
                <button onClick={() => setEditingBookingId(null)}>Cancel</button>
              </div>
            ) : (
              <div>
                {`Date: ${booking.bookingDate} | Duration: ${booking.duration} hour(s) | Name: ${booking.name} | Status: ${booking.status}`}
                <button onClick={() => handleEdit(booking)}>Edit</button>
                <button onClick={() => handleDelete(booking.bookingId)}>Delete</button>
              </div>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default BookingList;
